import "./s"
export const Todo = (p) => {
    return (
        <ul >
  <li>{p.td}</li>
  <li >{p.ap}</li>
  <li >{p.ma}</li>
  <li >{p.ki}</li>
  <li >{p.or}</li>

</ul>


    );
}


export const Doo = (p) => {
    return (
        <ul >
  <li>{p.td}</li>
  <li >{p.ap}</li>
  <li >{p.ma}</li>
  <li >{p.ki}</li>
  <li >{p.or}</li>

</ul>


    );
}
